============================================
Description:                               =
============================================

May the birds be with you! Angry Birds Star Wars will be out on November 8, but until then, watch this gameplay trailer and scream &quot;OH MY GOODNESS!!!!&quot; to yourself in the mirror. Repeatedly.

============================================
Instructions:                              =
============================================

* Install
* Activate the game (Patch Folder)

[1] Run AngryBirdsStarWars.exe and install the game
[2] Copy inside &quot;Patch&quot; folder files in the game directory
[3] Run from there &quot;angry.birds.all-patch.offline.v1.3.exe&quot;, Hit - Patch, choose &quot;AngryBirdsStarWars.exe&quot; 
[4] Open key.txt. Copy the key. 
[5] Run the game
[6] Choose &quot;Activate full version&quot;. Paste the key Ctrl+V  .
[7] Activate the game.

